package com.example.prescription_module.domain;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;@Entity@Getter@Setterpublic class MedicalHistory {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private Long idPatient;    private String disease;    public MedicalHistory() {    }    public MedicalHistory(Long id, Long idPatient, String disease) {        this.idPatient = idPatient;        this.disease = disease;    }}